module.exports = "<div class=\"container\">\n\t<div class=\"row\">\n\t\t<div class=\"col-lg-12\">\n\t\t\t<div class=\"landing container-fluid\">\n                <h1>Paxful, Inc. Privacy Notice</h1>\n                <p>Paxful, Inc. (also referred to as “Paxful,” “we,” “us,” or “our”) takes steps to protect your privacy.  In this Privacy Notice (“Notice”), we describe the types of personal information we may collect from you in connection with your use of our websites including, but not limited to, <a href=\"https://paxful.com/\" target=\"_blank\">https://paxful.com/</a>, the Paxful Wallet, our online bitcoin trading platform, mobile application, social media pages, or other online properties (collectively, the “Website”), or when you use any of the products, services, content, features, technologies, or functions we offer (collectively, the “Services”).</p>\n                <p>This Notice is designed to help you obtain information about our privacy practices and to help you understand your privacy choices when you use our Website and Services.  Please note that our Service offerings may vary by region.</p>\n                <p>For all purposes, the English language version of this privacy notice shall be the original, governing instrument. In the event of any conflict between the English language version of this privacy notice and any subsequent translation into any other language, the English language version shall govern and control.</p>\n\n                <h2>Personal information we collect</h2>\n                <p class=\"mb-0\">We collect information that relates to you (“Personal Data”) in connection with your use of the Website, our Services. or otherwise in the context of our relationship with you.  The types of Personal Data that we may obtain from you may include:</p>\n\n                <div class=\"row\">\n                    <div class=\"col-md-6 col-12 mb-5 mb-md-0\">\n                        <h3 class=\"landing__section-list-header\">\n                            Biographical Data, including:\n                        </h3>\n                        <ul class=\"mb-0\">\n                            <li>Name</li>\n                            <li>Email Address</li>\n                            <li>Phone Number</li>\n                            <li>Country</li>\n                            <li>Full Address</li>\n                            <li>Date of Birth</li>\n                        </ul>\n                    </div>\n\n                    <div class=\"col-md-6 col-12\">\n                        <h3 class=\"landing__section-list-header\">\n                            Paxful Account Details, including:\n                        </h3>\n                        <ul class=\"mb-0\">\n                            <li>Username</li>\n                            <li>User Profile Information in the “Bio” section</li>\n                            <li>Profile Picture</li>\n                            <li>Joined Date</li>\n                            <li>Default Currency</li>\n                            <li>Time Zone</li>\n                            <li>Default Language</li>\n                        </ul>\n                    </div>\n                </div>\n\n                <div class=\"row\">\n                    <div class=\"col-md-6 col-12 mb-5 mb-md-0\">\n                        <h3 class=\"landing__section-list-header\">\n                            Paxful Account Activity, including:\n                        </h3>\n                        <ul class=\"mb-0\">\n                            <li>Trade Chat Messages (which may contain financial information if you provide it to sellers)</li>\n                            <li>Trade Chat Attachments</li>\n                            <li>Trade Activity</li>\n                            <li>Transaction History</li>\n                            <li>Affiliate Name</li>\n                            <li>Affiliate ID</li>\n                            <li>Affiliate Link</li>\n                            <li>Affiliate Transactions</li>\n                            <li>Offers Created</li>\n                            <li>Offer Terms</li>\n                            <li>Trade Instructions</li>\n                            <li>Account Notifications</li>\n                            <li>Account Status</li>\n                        </ul>\n                    </div>\n\n                    <div class=\"col-md-6 col-12\">\n                        <h3 class=\"landing__section-list-header\">\n                            Data relating to your Bitcoin wallet, including:\n                        </h3>\n                        <ul class=\"mb-0\">\n                            <li>Bitcoin Private Keys</li>\n                            <li>Bitcoin Public Keys</li>\n                            <li>Wallet Balance</li>\n                            <li>Bitcoin transactions received</li>\n                            <li>Bitcoin transactions sent</li>\n                        </ul>\n                    </div>\n                </div>\n\n                <div class=\"row\">\n                    <div class=\"col-md-6 col-12 mb-5 mb-md-0\">\n                        <h3 class=\"landing__section-list-header\">\n                            Data Collected in connection with “Know Your Customer” (KYC) Compliance, including:\n                        </h3>\n                        <ul class=\"mb-0\">\n                            <li>Government-issued ID</li>\n                            <li>Proof of Address</li>\n                            <li>Photographs, if you elect to provide them to us</li>\n                            <li>Video, if you elect to provide them to us</li>\n                        </ul>\n                    </div>\n\n                    <div class=\"col-md-6 col-12\">\n                        <h3 class=\"landing__section-list-header\">\n                            Device and Website Usage Data, including:\n                        </h3>\n                        <ul class=\"mb-0\">\n                            <li>IP Addresses</li>\n                            <li>Cookie ID and/or other device identifiers</li>\n                            <li>Information relating to your access to the Website, such as device characteristics, date & time</li>\n                            <li>Language preferences</li>\n                            <li>Information on actions taken while using the Website</li>\n                        </ul>\n                    </div>\n                </div>\n\n                <h2>How we use your data</h2>\n                <p >The business purposes for which we collect, use, retain, and share your Personal Data may include:</p>\n                <ul>\n                    <li>\n                        <p>\n                            To provide Services through operating the Website, including to:\n                        </p>   \n                        <ul>\n                            <li>Register, create, and maintain your account;</li>\n                            <li>Authenticate your identity and/or your access to an account, or help sellers verify your identity;</li>\n                            <li>Initiate, facilitate, process, and/or execute transactions;</li>\n                            <li>Communicate with you regarding your account or any Services you use;</li>\n                            <li>Perform creditworthiness, KYC, or other similar reviews;</li>\n                            <li>Evaluate applications; or</li>\n                            <li>Compare information for accuracy and verification purposes.</li>\n                        </ul>\n                    </li>\n                    <li>To manage risk and protect you, other persons, and the Website and Services.</li>\n                    <li>To provide a personalized experience and implement your preferences.</li>\n                    <li>To better understand customers and how they use and interact with the Website and Services.</li>\n                    <li>To market to you.</li>\n                    <li>To provide personalized Services, offers, and promotions on our Website and third-party websites.</li>\n                    <li>To provide you with location-specific options, functionalities, and offers.</li>\n                    <li>To comply with our policies and obligations, including, but not limited to, disclosures and responses in response to any requests from law enforcement authorities and/or regulators in accordance with any applicable law, rule, regulation, judicial or governmental order, regulatory authority of competent jurisdiction, discovery request or similar legal process.</li>\n                    <li>To resolve disputes, collect fees, or troubleshoot problems.</li>\n                    <li>To provide customer service to you or otherwise communicate with you.</li>\n                    <li>To manage our business.</li>\n                </ul>\n                <p>\n                    We may also process Personal Data for other purposes based upon your consent when required by applicable law.\n                </p>\n\n                <h2>Sources from which we collect personal data</h2>\n                <p>We collect Personal Data from a number of sources, including</p>\n                <ul>\n                    <li>\n                        <b>Directly from you: </b>\n                        We collect Personal Data directly from you when you use our Website or Services, communicate with us, or interact directly with us.\n                    </li>\n                    <li>\n                        <b>From service providers and/or data processors who assist us in providing the Website or the Services: </b>\n                        We may engage service providers to assist us in facilitating the Website or the Services to you, at our direction and on our behalf.  These service providers may collect information about you and provide it to us.\n                    </li>\n                    <li>\n                        <b>From other users on the Paxful Website or from affiliates integrated with the Paxful Website or Services: </b>\n                        Other users may provide us with information about you in connection with transactions or chats.  Affiliates may also provide information to us about you related to your interactions or transactions with such affiliates.\n                    </li>\n                    <li>\n                        From third-parties who may help us verify identity, prevent fraud, and protect the security of transactions.\n                    </li>\n                    <li>\n                        From third-parties who may help us evaluate your creditworthiness or financial standing.\n                    </li>\n                    <li>\n                        From third-parties who may help us analyze Personal Data, improve the Website or the Services or your experience on it, market products or services, or provide promotions and offers to you.\n                    </li>\n                    <li>\n                        From social media platforms, if you interact with us through social media.\n                    </li>\n                </ul>\n\n                <h2>How we share data</h2>\n                <p>Under certain circumstances, we may disclose certain Personal Data with other persons. The categories of persons with whom we may share Personal Data include:</p>\n                <ul>\n                    <li>\n                        <b>Service providers and/or data processors: </b>\n                        We may share Personal Data with third-party service providers that perform services and functions at our direction and on our behalf. These third-party service providers may, for example, provide you with Services, verify your identity, assist in processing transactions, send you advertisements for our products and Services, or provide customer support.\n                    </li>\n                    <li>\n                        <b>Other parties to transactions, such as sellers: </b>\n                        We may share information with the other participants to your transactions, including other users from whom you are purchasing bitcoin.\n                    </li>\n                    <li>\n                        Financial institutions and other companies involved in helping you make payments in connection with transactions \n                    </li>\n                    <li>\n                        Affiliates that receive referrals from our Website\n                    </li>\n                    <li>\n                        <p>\n                            Other third-parties for our business purposes or as permitted or required by law, including: \n                        </p>\n                        <ul>\n                            <li>To comply with any legal, regulatory or contractual obligation, or with any legal or regulatory process (such as a valid court order or subpoena);</li>\n                            <li>To establish, exercise, or defend legal claims;</li>\n                            <li>In response to a request by a government agency, such as law enforcement authorities or a judicial order;</li>\n                            <li>To enforce our Website Terms of Service or our internal policies;</li>\n                            <li>To prevent physical harm or financial loss, in connection with an investigation of suspected or actual illegal activity, or to otherwise protect our or others’ rights, property, or safety;</li>\n                            <li>To facilitate a purchase or sale of all or part of Paxful’s business.  For example, by sharing data with a company we plan to merge with or be acquired by; or</li>\n                            <li>To support our audit, compliance, and corporate governance functions.</li>\n                        </ul>\n                    </li>\n                </ul>\n                \n                <h2>International transfers of data</h2>\n                <p>Please note that we may transfer Personal Data we collect about you to countries other than the country in which the information was originally collected.  Those countries may not have the same data protection laws as the country in which you initially provided the information.  When we transfer your Personal Data to other countries, we take steps designed to ensure that the transfer is in accordance with applicable law.</p>\n\n                <h2>Cookies and online advertising</h2>\n                <ul>\n                    <li>A cookie is a small text file that a website saves on your computer or mobile device when you visit the website.</li>\n                    <li>Our Website uses cookies and tracking technologies to operate, and to target advertising that may be of interest to you.  For further information, please refer to our Cookie Policy.</li>\n                    <li>\n                        <p>\n                            Paxful may partner with third-party ad networks to either display advertising on the Paxful Website or on third-party websites.  These websites and third-party ad networks are not controlled by Paxful.  Ad network partners use data technologies to collect information about your online activities to provide you targeted advertising based upon your interests. If you wish not to have this information used for the purpose of serving you targeted ads, you may be able to opt-out by visiting:\n                        </p>\n                        <ul>\n                            <li>\n                                <a target=\"_blank\" href=\"http://optout.aboutads.info/\">http://optout.aboutads.info/</a>\n                            </li>\n                            <li>\n                                <a target=\"_blank\" href=\"http://optout.networkadvertising.org/\">http://optout.networkadvertising.org/</a>\n                            </li>\n                        </ul>\n                    </li>\n                </ul>\n                \n                <p>Please note this does not opt you out from being served advertising; you will continue to receive generic ads that are not based on your specific interests.\nYou can control the use of cookies at the individual browser level. If you reject cookies, you may still use our Website, but your ability to use some features or areas of our Website may be limited.</p>\n\n                <h2>Data retention</h2>\n                <p>We retain Personal Data for the period necessary for the purposes for which it was collected, or for such periods as required by applicable law.  This may involve retaining Personal Data for periods following a transaction.  We make efforts to delete your Personal Data once it is no longer required for any of the business purposes described above.</p>\n\n                <h2>Data security</h2>\n                <p>Paxful has implemented safeguards designed to protect your Personal Data, including measures designed to prevent Personal Data against loss, misuse, and unauthorized access and disclosure.  Still, Paxful cannot ensure or warrant the security or confidentiality of information you transmit to us or receive from us by Internet or wireless connection.  Transferring data through the Internet always carries some risk, even if Paxful makes efforts to protect data once it has received it.</p>\n\n                <h2>Children under 18 years of age</h2>\n                <p>Paxful’s Website is not intended for children under the age of 18. We do not knowingly collect data from children under the age of 18 without verified parental consent. If we learn that we have collected information, including Personal Data, from an individual under 18 years of age without parental consent, we will delete that information immediately.</p>\n\n                <h2>Modifications to the privacy notice</h2>\n                <p>Paxful reserves the right to change this Notice from time to time. We will notify you of modifications to this Notice by posting a revised version of this Notice here, by email, or by means of a prominent notice on the Paxful Website home page. We recommend that you periodically check the Website for any changes.</p>\n\n                <h2>Contact us</h2>\n                <p>If you have any questions about this Notice, or wish to make an inquiry with us regarding Personal Data or privacy, please contact us at: <a href=\"/cdn-cgi/l/email-protection#0373716a7562607a4373627b65766f2d606c6e\"><span class=\"__cf_email__\" data-cfemail=\"f585879c8394968cb585948d938099db969a98\">[email&#160;protected]</span></a></p>\n\n                <h2>EEA Addendum</h2>\n                <p>The following disclosures apply to, and are intended exclusively for, individuals who reside within the European Economic Area (EEA).</p>\n\n                <h3>Data Controller</h3>\n                <p>The controller for your Personal Data is Paxful, Inc.</p>\n\n                <h3>Legal Bases for Processing Personal Data</h3>\n                <ul>\n                    <li>To the extent we use Personal Data to perform contractual obligations or requests made by you in connection with a contract, Article 6(1)(b) of the General Data Protection Regulation (“GDPR”) is the legal basis for our data processing.</li>\n                    <li>To the extent we use Personal Data to comply with a legal obligation under EU or Member State law, Article 6(1)(c) of the GDPR is the legal basis for our data processing.</li>\n                    <li>To the extent we use Personal Data to protect the vital interests of individuals, Article 6(1)(d) of the GDPR is the legal basis for our data processing.</li>\n                    <li>To the extent we use Personal Data in pursuit of our legitimate business interests, Article 6(1)(f) of the GDPR is the legal basis for our data processing.  A list of our legitimate business interests is in the above section titled “How We Use Your Data”.</li>\n                </ul>\n\n                <h3>European Data Protection Rights</h3>\n                <p>European law provides you with certain rights with respect to your Personal Data, including:</p>\n                <ul>\n                    <li>The right to request access to and rectification of your Personal Data.</li>\n                    <li>The right to request that Paxful delete certain Personal Data relating to you.</li>\n                    <li>The right to data portability, which includes the right to request that certain Personal Data you have provided to us be transferred from us to another data controller.</li>\n                    <li>The right to withdraw any consent you have provided to Paxful to collect, use, or share your data at any time. Please note that withdrawing consent does not affect the lawfulness of Paxful processing your Personal Data before your withdrawal.</li>\n                    <li>The right to object to Paxful’s processing of your Personal Data, based on grounds specific to your particular situation.</li>\n                    <li>The right to request that Paxful restrict the processing of your Personal Data, if certain statutory conditions for restriction are met.</li>\n                    <li>The right to lodge a complaint with a European supervisory authority.</li>\n                </ul>\n                <p>Please note that applicable law may provide exceptions to any of these rights, permit Paxful to decline your request, or permit Paxful to extend the period in which it can act on your request.  Paxful may also contact you to verify your identity, as permitted by law, prior to acting on your request.  To exercise any of these rights, please contact us as set forth in the above section titled “Contact Us”.</p>\n\n                <h3>International Transfers</h3>\n                <p>We may transfer Personal Data relating to EEA residents to countries that have not been found by the European Commission to provide adequate protection, including the United States.  For any such transfers, Paxful implements safeguards designed to ensure that your Personal Data receives an adequate level of protection. If you are located in the EEA, Paxful will only transfer your Personal Data if: the country to which the Personal Data will be transferred has been granted a European Commission adequacy decision; the recipient of the Personal Data is located in the United States and has certified to the US-EU Privacy Shield Framework; Paxful has put in place appropriate safeguards in respect of the transfer, for example by entering into EU Standard Contractual Clauses with the recipient, or; an applicable statutory exception to the GDPR general transfer prohibition applies.  To obtain a copy of the mechanisms that Paxful has executed to support its transfers of personal data outside the EEA, contact us as set forth in the above “Contact Us” section.</p>\n\n                <h2>California Addendum</h2>\n                <p>The following disclosures apply to, and are intended exclusively for, residents of the State of California.</p>\n\n                <h3>Your California Privacy Rights</h3>\n                <p>To the extent that we disclose certain personally identifiable information about you to third parties who use it for their direct marketing purposes, you have a right to request further information about the recipients of your information.  To exercise this right, please contact us as described in the above section titled “Contact Us.”</p>\n\n                <h3>Do Not Track Disclosure</h3>\n                <p>Our Website is not designed to respond to “Do Not Track” signals or requests. </p>\n      \n        <div class=\"landing container-fluid\">\n            <div class=\"landing__table-heading\">\n                <span class=\"heading-label\">facts</span>\n                <h2>What does Paxful do with your personal information?</h2>\n            </div>\n            <div class=\"table-responsive\">\n                <table class=\"table table-bordered table-primary\">\n                    <tbody>\n                        <tr class=\"left-side-title\">\n                            <th class=\"bg-grey text-nowrap\">\n                                Why?\n                            </th>\n                            <td class=\"w-100\">\n                                <p>Financial companies choose how they share your personal information. Federal law gives consumers the right to limit some but not all sharing. Federal law also requires us to tell you how we collect, share, and protect your personal information. Please read this notice carefully to understand what we do.</p>\n                            </td>\n                        </tr>\n                    </tbody>\n                </table>\n            </div>\n            <div class=\"table-responsive\">\n                <table class=\"table table-bordered table-primary\">\n                    <tbody>\n                        <tr class=\"left-side-title\">\n                            <th class=\"bg-grey text-nowrap\">\n                                What?\n                            </th>\n                            <td class=\"w-100\">\n                                <p>The types of personal information we collect and share depend on the product or service you have with us. This information can include:</p>\n                                <ul>\n                                    <li>Social Security number or account balances</li>\n                                    <li>Payment history or transaction history</li>\n                                    <li>Credit history or credit scores</li>\n</ul>\n                                <p>\n                                    When you are <i>no longer</i> our customer, we continue to share your information as described in this notice.\n                                </p>\n                            </td>\n                        </tr>\n                    </tbody>\n                </table>\n            </div>\n            <div class=\"table-responsive\">\n                <table class=\"table table-bordered table-primary\">\n                    <tbody>\n                        <tr class=\"left-side-title\">\n                            <th class=\"bg-grey text-nowrap\">\n                                How?\n                            </th>\n                            <td class=\"w-100\">\n                                <p>\n                                    All financial companies need to share customers&#039; personal information to run their everyday business. In the section below, we list the reasons financial companies can share their customers&#039; personal information; the reasons Paxful chooses to share; and whether you can limit this sharing.\n                                </p>\n                            </td>\n                        </tr>\n                    </tbody>\n                </table>\n            </div>\n            <br/>\n            <div class=\"table-responsive\">\n                <table class=\"table table-bordered table-primary\">\n                    <thead>\n                        <tr>\n                            <th class=\"bg-grey\">\n                                <p>\n                                    Reasons we can share your personal information\n                                </p>\n                            </th>\n                            <th class=\"bg-grey\">\n                                <p class=\"text-nowrap\">\n                                    Does Paxful share?\n                                </p>\n                            </th>\n                            <th class=\"bg-grey\">\n                                <p class=\"text-nowrap\">\n                                    Can you limit this sharing?\n                                </p>\n                            </th>\n                        </tr>\n                    </thead>\n                    <tbody>\n                        <tr>\n                            <td>\n                                <p>\n                                    <b>For our everyday business purposes</b> - such as to process your transactions, maintain your account(s), respond to court orders and legal investigations, or report to credit bureaus\n                                </p>\n                            </td>\n                            <th>\n                                <p>Yes</p>\n                            </th>\n                            <th>\n                                <p>No</p>\n                            </th>\n                        </tr>\n                        <tr>\n                            <td>\n                                <p>\n                                    <b>For our marketing purposes</b> - to offer our products and services to you\n                                </p>\n                            </td>\n                            <th>\n                                <p>Yes</p>\n                            </th>\n                            <th>\n                                <p>No</p>\n                            </th>\n                        </tr>\n                        <tr>\n                            <td>\n                                <p>\n                                    <b>For joint marketing with other financial companies</b>\n                                </p>\n                            </td>\n                            <th>\n                                <p>Yes</p>\n                            </th>\n                            <th>\n                                <p>No</p>\n                            </th>\n                        </tr>\n                        <tr>\n                            <td>\n                                <p>\n                                    <b>For our affiliates' everyday business purposes</b> - information about your transactions and experiences\n                                </p>\n                            </td>\n                            <th>\n                                <p>Yes</p>\n                            </th>\n                            <th>\n                                <p>No</p>\n                            </th>\n                        </tr>\n                        <tr>\n                            <td>\n                                <p>\n                                    <b>For our affiliates' everyday business purposes</b> - information about your creditworthiness\n                                </p>\n                            </td>\n                            <th>\n                                <p>No</p>\n                            </th>\n                            <th>\n                                <p>We don&#039;t share</p>\n                            </th>\n                        </tr>\n                        <tr>\n                            <td>\n                                <p>\n                                    <b>For nonaffiliates to market to you</b>\n                                </p>\n                            </td>\n                            <th>\n                                <p>No</p>\n                            </th>\n                            <th>\n                                <p>We don&#039;t share</p>\n                            </th>\n                        </tr>\n                    </tbody>\n                </table>\n            </div>\n            <div class=\"table-responsive\">\n                <table class=\"table table-bordered table-primary\">\n                    <tbody>\n                        <tr class=\"left-side-title\">\n                            <th class=\"bg-grey text-nowrap\">\n                                Questions?\n                            </th>\n                            <td class=\"w-100\">\n                                <p>Go to <a href=\"https://paxful.com\" target=\"_blank\">www.paxful.com</a></p>\n                            </td>\n                        </tr>\n                    </tbody>\n                </table>\n            </div>\n            <div class=\"table-responsive\">\n                <table class=\"table table-bordered table-primary\">\n                    <thead>\n                        <tr>\n                            <th class=\"bg-grey\" colspan=\"2\">\n                                <p>\n                                    Who we are\n                                </p>\n                            </th>\n                        </tr>\n                    </thead>\n                    <tbody>\n                        <tr>\n                            <th>\n                                <p>\n                                    Who is providing this notice?\n                                </p>\n                            </th>\n                            <td>\n                                <p>The privacy notice is provided by Paxful and is applicable to your personal Paxful account. </p>\n                            </td>\n                        </tr>\n                    </tbody>\n                </table>\n            </div>\n            <div class=\"table-responsive\">\n                <table class=\"table table-bordered table-primary\">\n                    <thead>\n                        <tr>\n                            <th class=\"bg-grey\" colspan=\"3\">\n                                <p>\n                                    What we do\n                                </p>\n                            </th>\n                        </tr>\n                    </thead>\n                    <tbody>\n                        <tr>\n                            <th>\n                                <p>How does Paxful protect my personal information?</p>\n                            </th>\n                            <td>\n                                <p>To protect your personal information from unauthorized access and use, we use security measures that comply with federal law. These measures include computer safeguards and secured files and buildings.</p>\n                            </td>\n                        </tr>\n                        <tr>\n                            <th>\n                                <p>How does Paxful collect my personal information?</p>\n                            </th>\n                            <td>\n                                <p>We collect your personal information, for example, when you</p>\n                                <ul>\n                                    <li>open an account or provide account information</li>\n                                    <li>give us contact information or make a transfer</li>\n                                    <li>use your Paxful account to send or receive funds</li>\n</ul>\n                                <p>\n                                    We also collect personal information from others, such as credit bureaus, affiliates, and other companies.\n                                </p>\n                            </td>\n                        </tr>\n                        <tr>\n                            <th>\n                                <p>Why can’t I limit all sharing?</p>\n                            </th>\n                            <td>\n                                <p>Federal law gives you the right to limit only</p>\n                                <ul>\n                                    <li>sharing for affiliates&#039; everyday business purposes — information about your creditworthiness</li>\n                                    <li>affiliates from using your information to market to you</li>\n                                    <li>sharing for nonaffiliates to market to you</li>\n</ul>\n                                <p>\n                                    State laws and individual companies may give you additional rights to limit sharing. See below for more on your rights under state law. \n                                </p>\n                            </td>\n                        </tr>\n                    </tbody>\n                </table>\n            </div>\n            <div class=\"table-responsive\">\n                <table class=\"table table-bordered table-primary\">\n                    <thead>\n                        <tr>\n                            <th class=\"bg-grey\" colspan=\"3\">\n                                <p>\n                                    Definitions\n                                </p>\n                            </th>\n                        </tr>\n                    </thead>\n                    <tbody>\n                        <tr>\n                            <th>\n                                <p>Affiliates</p>\n                            </th>\n                            <td>\n                                <p>Companies related by common ownership or control. They can be financial and nonfinancial companies.</p>\n                                <ul>\n                                    <li>Our affiliates include companies under common control of Paxful Holdings, Inc.</li>\n                                </ul>\n                            </td>\n                        </tr>\n                        <tr>\n                            <th>\n                                <p>Nonaffiliates</p>\n                            </th>\n                            <td>\n                                <p>Companies not related by common ownership or control. They can be financial and nonfinancial companies.</p>\n                                <ul>\n                                    <li>Nonaffiliates with which we share personal information include service providers that perform services or functions on our behalf.</li>\n                                </ul>\n                            </td>\n                        </tr>\n                        <tr>\n                            <th>\n                                <p>Joint marketing</p>\n                            </th>\n                            <td>\n                                <p>A formal agreement between nonaffiliated financial companies that together market financial products or services to you.</p>\n                                <ul>\n                                    <li>Our joint marketing partners include financial companies.</li>\n                                </ul>\n                            </td>\n                        </tr>\n                    </tbody>\n                </table>\n            </div>\n            <div class=\"table-responsive\">\n                <table class=\"table table-bordered table-primary\">\n                    <thead>\n                        <tr>\n                            <th class=\"bg-grey\">\n                                <p>\n                                    Other important information\n                                </p>\n                            </th>\n                        </tr>\n                    </thead>\n                    <tbody>\n                        <tr>\n                            <td>\n                                <p>We may transfer personal information to other countries, for example, for customer service or to process transactions.</p>\n                                <p>California: If your Paxful account has a California mailing address, we will not share personal information we collect about you except to the extent permitted under California law.</p>\n                                <p>Vermont: If your Paxful account has a Vermont address, we will not share personal information we collect about you with nonaffiliates unless the law allows or you provide authorization.</p>\n                            </td>\n                        </tr>\n                    </tbody>\n                </table>\n            </div>\n        </div>\n    \n</div>\n\t\t</div>\n\t</div>\n</div>\n\n<app-footer></app-footer>"

